import { PieceModel } from '../../../../model/PieceModel';

export function Piece(props:{piece:PieceModel}){
    let piece =props.piece;
    return (
            <div>
                <img src = {piece.imageURI}
                     draggable="true">
                </img>
            </div>
            );
}
